import React from "react";
import VideoItem from "./VideoItem";

function VideoList({ videos }) {
  return (
    <div>
      {videos.map((video) => (
        <VideoItem key={video.id.videoId} title={video.snippet.title} />
      ))}
    </div>
  );
}

export default VideoList;
